        fire.auth().signInWithEmailAndPassword(email, pass)
        .catch(e => {
    
        })
    }


  return (
    <div>
        <h1>Login</h1>
        <TextField label="Email" style={{
                width: window.innerWidth / 4
                }}></TextField> <br />
        <TextField label="Password" style={{
                width: window.innerWidth / 4
                }}></TextField> <br /> <br />
        <Button size="large" variant="outlined" onClick={handleLogin}>Log in</Button>
    </div>
  );
}

